class ProfileScreen extends StatefulWidget {
  createState() {
    return _profileState();
  }
}

late Future<UserProfileModel>? userDetails;

class _profileState extends State<ProfileScreen> {
  var user;
  String? name;
  String? description;
  int? employeeLevel;
  int? officeLocation;
  int? userRole;
  String? phoneNumber;

  initState() {
    var userProfile = new UserProvider();
    setState(() {
      userDetails = userProfile.getUserProfile();
      user = FirebaseAuth.instance.currentUser;
    });
    initFunction(userDetails);
    print(user);
  }

  httpCall() async {
    var userHttp = new UserProvider();
    final user = await userHttp.getUserID();

    final response = await http.get(
      Uri.parse('https://10.0.2.2:5001/api/User/ViewProfile?UserId=$user'),
      headers: <String, String>{
        'Content-Type': 'application/json; charset=UTF-8',
      },
    );
    print(response.statusCode);
  }

  determineOffice() {
    if (officeLocation == 1) {
      return 'Braamfontein';
    }
    return 'Pretoria';
  }

  determineRole() {
    print(employeeLevel);
    switch (employeeLevel) {
      case 0:
        return 'Developer';
      case 1:
        return 'Designer';
      case 2:
        return 'Care Taker';
      case 3:
        return 'Scrum Master';
      case 4:
        return 'CAM';
      case 5:
        return 'Director';
      case 6:
        return 'Graduate';
      case 7:
        return 'Intern';
    }
  }

  initFunction(userDetails) async {
    setState(() {
      name = userDetails.name;
      description = userDetails.description;
      employeeLevel = userDetails.empLevel;
      officeLocation = userDetails.officeLocation;
      userRole = userDetails.userRoles;
      phoneNumber = userDetails.phoneNumber;
    });
  }

